import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsxRuntime classic */
/* @jsx mdx */
import BlogPost from '../../../components/BlogPost'
import Blog1 from '../../../components/blogposts/Blog1'
export const meta = {
  title: 'Planning',
  description: 'Getting started with the Next framework',
  date: 'Aug 04, 2020',
  readTime: 2
};

const layoutProps = {
  meta
};
const MDXLayout = ({ children }) => <Blog1 meta={meta}>{children}</Blog1>
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">



    <h2>{`My Headline`}</h2>
    <p>{`Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque maximus pellentesque dolor non egestas. In sed tristique elit. Cras vehicula, nisl vel ultricies gravida, augue nibh laoreet arcu, et tincidunt augue dui non elit. Vestibulum semper posuere magna, quis molestie mauris faucibus ut.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
